import axios from "axios";


export const validateInviteLink = (hash) => {
    return axios
        .get('http://localhost:3600n/invite/validate/', hash)
        .then((response) => {
            return response.data;
        });
};

export const submitInvite = (inviteData) => {
    return axios
        .post('http://localhost:3600/admin/invite/submit/', inviteData)
        .then((response) => {
            return response.data;
        });
};
